Description:&lt;br /&gt;
This VR headset skin is a good replacement for Oculus Quest 2, it can fit the VR headset perfectly without any modification.&lt;br /&gt;
The VR headset sticker can protect the headset, so the headset won&amp;#39;t easily be scratched.&lt;br /&gt;
The VR headset protector features a simple and fast installation and is convenient to be removed as well.&lt;br /&gt;
The VR headset cover is made of PVC that is strong and sturdy, long-lasting and abrasion-resistant.&lt;br /&gt;
The VR headset skin can also make your VR headset look more stylish and beautiful.&lt;br /&gt;
&lt;br /&gt;
Specifications:&lt;br /&gt;
Material: PVC.&lt;br /&gt;
Color: Show as picture.&lt;br /&gt;
Size: Show as picture.&lt;br /&gt;
Compatibility: Replacement for Oculus Quest 2.&lt;br /&gt;
&lt;br /&gt;
Note:&lt;br /&gt;
There might be a bit color distortions due to different computer resolutions.&lt;br /&gt;
There might be a slight errors due to different hand measurement.&lt;br /&gt;
&lt;br /&gt;
Package included:&lt;br /&gt;
1x Set sticker.
